import React from "react";
import Exit from "../assets/images/modal-exit.svg";
import { Container, Row, Col } from "react-grid-system";

function Modal() {
    return (
        <div className="team-modal">
            <div className="inner-modal">
                <Container>
                    <Row>
                        <Col xs={11}></Col>
                        <Col xs={1}>
                            <img 
                                src={Exit}
                                width="30px"
                                height="30px"
                            />
                        </Col>
                    </Row>
                </Container>
            </div>
        </div>
    );
}

export default Modal;
